import React from "react";
import styled from "styled-components";
export default function CourseCard(params) {
  return (
    <>
      <CardWrapper>
        <h3>Python Programmer</h3>
        <p>
          From data manipulation to unit testing, gain the career-building
          skills you need to succeed as a Python programmer. No prior coding
          experience needed.
        </p>
      </CardWrapper>
    </>
  );
}

const CardWrapper = styled.div`
  border-radius: 5px;
  display: flex;
  flex-direction: column;
  padding: 10px;
  background-color: lightgreen;
  max-width: 358px;
  text-align: left;
  h3 {
    font-size: 32px;
  }
  p {
    font-size: 16px;
  }
`;
